import React, { useState,useEffect} from 'react'
import { Link } from 'react-router-dom';
import StudentService from '../services/StudentService'

const AddUsersComponent = () => {
const [student,setStudent]=useState([])
useEffect(()=>{
    StudentService.getAllStudents().then((response)=>{
        setStudent(response.data);
console.log(response.data);
    }).catch(error=>{
        console.log(error);
    })

},[])
  return (
    <div className='container '>
         <Link to="/add-student" className='btn btn-primary me-5 my-5'>Add Student</Link>
         <Link to="/add-student" className='btn btn-primary me-5 my-5'>Add StudentInfo</Link>
      <h2 className="text-center"></h2>
      <table className='table table-bordered table-striped'>
<thead>
    <th>Student Id</th>
    <th>Student Name</th>
    <th>Mobile No.</th>
</thead>
<tbody>
    {
        student.map(
            student =>
            <tr key={student.id}>
                <td>{student.id}</td>
                <td>{student.name}</td>
                <td>{student.mobile_no}</td>
            </tr>
        )
    }
</tbody>
      </table>
      
     
    
    </div>
  )

}

export default AddUsersComponent
